    public int lengthOfLongestSubstring(String s) {
        if(s.length() == 0){
            return 0;
        }
        int result = 1;
        //声明一个Set集合
        Set<String> set = new HashSet<>();
        //分隔字符串
        String[] strings = s.split("");
        for (int i = strings.length; i > 0 && i > result; i--) {
            for (int j = strings.length - i; j < strings.length; j++) {
                String string = strings[j];
                if(set.contains(string)){
                    set.clear();
                    set.add(string);
                }else{
                    set.add(string);
                    if(set.size() > result){
                        result = set.size();
                    }
                }
            }
            set.clear();
        }
        return result;
    }

    public int lengthOfLongestSubstring2(String s) {
        int result = 1;
        //声明一个Set集合
        Set<Character> set = new HashSet<>();
        //循环遍历
        for (int i = 0; i < s.length() ; i++) {
            char string = s.charAt(i);
            if(set.contains(string)){
                set.clear();
                set.add(string);
            }else{
                set.add(string);
                if(set.size() > result){
                    result = set.size();
                }
            }
        }
        return result;
    }

